import {SAVE_COLOR} from '../type';
import {SAVE_NAME} from '../type';

export const saveColor=(data)=> dispatch => {

    return dispatch({
            type:SAVE_COLOR,
            payload:data
        })

}
export const saveName=(data)=> dispatch => {
    return dispatch({
        TYPE: SAVE_NAME,
        payload: data
    })
}
